import React, { useState } from 'react';

function Header() {
    const [employee, setEmployee] = useState([
        {
            id:1,
            name: "Suraj",
            age: 29,
            address: "Delhi"
        },
        {
            id:2,
            name: "John",
            age: 44,
            address: "Nepal"
        }
    ]);

    const handerColor = () => {
        setEmployee("Green")
    }
    return (
        <div>
            <ul>
                {
                    employee.map((name) => {
                        <li>{employee.name}</li>
                    })
                }
            </ul>
            <button type="button" onClick={() => setEmployee({
                name: "Ravi",
                age: 33,
                address: "Gurgaon"
            })}>click me!</button>
        </div>
    )
}

export default Header;
